import React from 'react';

export default function About() {
    return (
        <div>
            <h1 className="text-danger">AboutUs</h1>
            <p>
            The company has decided to launch a new app called FindMyEvents where users can view and add upcoming events in their region. bBackend development has been outsourced and frontend will be developed in-house. During sprint planning, you agree to lead this project and develop an app that will let users find events using APIs that backend engineers will provide.
            </p>
            <p className="text-secondary"></p>
        </div>
    )
}
